import { StyleSheet } from 'react-native'

export const textStyle = StyleSheet.create<any>({
  title: {
    fontFamily: 'sono',
    fontSize: 24,
    textAlign: 'center',
    fontWeight: 'bold',
  },
  radioText: {
    fontFamily: 'sono',
    fontSize: 16,
    textAlign: 'center',
  }
})
